import React from 'react';
import Banner from './Banner.PNG';
import './welcome.css';



const Welcomepage = () => {
  return (
    <div>
      <div className='banner'>
        <img src={Banner} className="App-banner" class="img-fluid" alt="banner"/>
      </div>
      <div class="text-center" className='text'><h1 class="display-6">What can we help you?</h1></div>
    </div> 
  );
};

export default Welcomepage;
